import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom'
import './App.css';
import Header from './components/templateLayout/Header.js';
import Footer from './components/templateLayout/Footer.js';
import ViewFlashcardSet from './components/pages/viewFlashcardSet/ViewFlashcardSet.js';
import EditFlashcardSet from './components/pages/editFlashcardSet/EditFlashcardSet.js';

class App extends Component {

    render() {
        return (
            <Router>
                <div className="App">
                <div id='container'>
                    <div id='side-left'/>
                    <Header/>
                    <div id='side-right'/>

                    <div id='content'>
                        <Route exact path='/view' component={ViewFlashcardSet}/>
                        <Route exact path='/edit' component={EditFlashcardSet}/>
                    </div>

                    <Footer id='footer'/>
                </div>
                </div>
            </Router>
        );
    }
}

export default App;
